import React, { Component } from "react";
import { View, PanResponder, Image, Button, StyleSheet, NativeModules } from "react-native";
import Svg, {Polygon, Circle} from 'react-native-svg';

import beautifulImage from './src/assets/beautiful-place.jpg';
import resolveAssetSource from 'resolveAssetSource';

export default class SingleImageApp extends Component {
    state = {
        polygonPoints: [ {x: 104, y: 36}, {x: 216, y: 83}, {x: 208, y:170}, {x: 80, y:140} ],
        polygonCornerRadius: 10,
        pressedCorner : -1,
        screen: { width: 0, height: 0}
    }

    componentWillMount=() => {
        this._image = resolveAssetSource(beautifulImage)
        this.state.image = {uri: this._image.uri}
    }

    panResponder = PanResponder.create({
        onStartShouldSetPanResponder: (event, gesture) => {
            const inCircle1 = this._pointInCircle(this.state.polygonPoints[0], this.state.polygonCornerRadius, {x: event.nativeEvent.locationX, y: event.nativeEvent.locationY})
            const inCircle2 = this._pointInCircle(this.state.polygonPoints[1], this.state.polygonCornerRadius, {x: event.nativeEvent.locationX, y: event.nativeEvent.locationY})
            const inCircle3 = this._pointInCircle(this.state.polygonPoints[2], this.state.polygonCornerRadius, {x: event.nativeEvent.locationX, y: event.nativeEvent.locationY})
            const inCircle4 = this._pointInCircle(this.state.polygonPoints[3], this.state.polygonCornerRadius, {x: event.nativeEvent.locationX, y: event.nativeEvent.locationY})

            console.log("onStartShouldSetPanResponder: returnValue", (inCircle1 || inCircle2 || inCircle3 || inCircle4), ", pressedCorner=", this.state.pressedCorner, ", (x,y)=(", event.nativeEvent.locationX, ",", event.nativeEvent.locationY, ")")
            return (inCircle1 || inCircle2 || inCircle3 || inCircle4)
        },
        onPanResponderGrant: (event, gesture) => {
            const inCircle1 = this._pointInCircle(this.state.polygonPoints[0], this.state.polygonCornerRadius, {x: event.nativeEvent.locationX, y: event.nativeEvent.locationY})
            const inCircle2 = this._pointInCircle(this.state.polygonPoints[1], this.state.polygonCornerRadius, {x: event.nativeEvent.locationX, y: event.nativeEvent.locationY})
            const inCircle3 = this._pointInCircle(this.state.polygonPoints[2], this.state.polygonCornerRadius, {x: event.nativeEvent.locationX, y: event.nativeEvent.locationY})
            const inCircle4 = this._pointInCircle(this.state.polygonPoints[3], this.state.polygonCornerRadius, {x: event.nativeEvent.locationX, y: event.nativeEvent.locationY})

            let selectedCorner = -1
            if(inCircle1) {
                selectedCorner = 0
            }else if(inCircle2) {
                selectedCorner = 1
            }else if(inCircle3) {
                selectedCorner = 2
            }else if(inCircle4) {
                selectedCorner = 3
            }
            
            this.setState((prevState)=> {
                return {
                    ...prevState,
                    pressedCorner: selectedCorner
                }
            })
        },
        onPanResponderMove: (event, gesture) => {
            const cornerPos = {x: event.nativeEvent.locationX, y: event.nativeEvent.locationY}
            this.setState((prevState) => {
                let newPolygonPoints = prevState.polygonPoints
                newPolygonPoints[prevState.pressedCorner] = cornerPos
                return {
                    ...prevState,
                    polygonPoints: newPolygonPoints
                }
            })
        },
        onPanResponderEnd: (event, gesture) => {
            this.setState((prevState)=> {
                return {
                    ...prevState,
                    pressedCorner: -1
                }
            })
        }
    })

    _onLayoutHandler = (event) => {
        const {nativeEvent: {layout: {x, y, width, height}}} = event
        
        const scaleRatio = width/this._image.width
        const newHeight = this._image.height * scaleRatio

        console.log(`_onLayoutHandler: x=${x}, y=${y}, width=${width}, height=${height} screenWidth=${width} screenHeight=${newHeight}`)

        this.setState((prevState) => {
            return {
                ...prevState,
                screen: {width: width, height: newHeight}
            }
        })
    }

    _pointInCircle = (centerOfCircle, radius, point) => {
        return (Math.pow(centerOfCircle.x - point.x, 2) + Math.pow(centerOfCircle.y - point.y, 2) <= Math.pow(radius,2))
    }
    
    _circlePressHandler = (cornerIndex) => {
        console.log("_circlePressHandler: cornerIndex=", cornerIndex)
        this.setState((prevState)=> {
            return {
                ...prevState,
                pressedCorner: cornerIndex
            }
        })
        return true
    }

    _crop = () => {
        const imgBase64 = ''
        NativeModules.OpenCV.fourPointTransform(imgBase64, this.state.screen, this.state.polygonPoints, (warpedImageBase64) => {
            this.setState((prevState) => {
                return {
                    ...prevState,
                    croppedImage: {uri: `data:image/gif;base64,${warpedImageBase64}`}
                }
            })
        }, (error) => {console.log("error on cropping. ",error)})
        //NativeModules.OpenCV.test("45", (warpedImage) => {console.log(warpedImage)})
    }

    _layoutHandler = (event, name) => {
        const {nativeEvent: {layout: {x, y, width, height}}} = event
        console.log(`${name}: x=${x}, y=${y}, width=${width}, height=${height}, imageWidth=${this._image.width}, imageHeight=${this._image.height}`)
    }
    
    render() {
        let croppedImageContent = null
        if(this.state.croppedImage != null) {
            croppedImageContent = (
                <Image source={this.state.croppedImage} 
                    onLayout={this._onLayoutHandler}
                    resizeMode="contain" 
                    style={[{width: "100%", height: "100%"}, styles.placeImage]}/>
            )
        }

      return (
        <View 
            style={{backgroundColor: "#fff", justifyContent: "flex-start", width:"100%", paddingTop: 50}}
            onLayout={(event) => this._layoutHandler(event, "main")}>

            <View 
                style={{backgroundColor: "#fff", width:"100%", height:this.state.screen.height}}
                onLayout={this._onLayoutHandler} {...this.panResponder.panHandlers}>

                <Image source={this.state.image} 
                    resizeMode="contain" 
                    style={[{position: "absolute",  width: this.state.screen.width, height: this.state.screen.height}, styles.placeImage]}
                    onLayout={(event) => this._layoutHandler(event, "image")}
                    ref={this._imageRef}/>

                <Svg style={{width: "100%", height: "100%"}}>
                    <Circle 
                        cx={this.state.polygonPoints[0].x}
                        cy={this.state.polygonPoints[0].y}
                        r={this.state.polygonCornerRadius}
                        fill={this.state.pressedCorner == 0 ? "white" : "pink"}
                    />
                    <Circle 
                        cx={this.state.polygonPoints[1].x}
                        cy={this.state.polygonPoints[1].y}
                        r={this.state.polygonCornerRadius}
                        fill={this.state.pressedCorner == 1 ? "white" : "pink"}
                    />
                    <Circle 
                        cx={this.state.polygonPoints[2].x}
                        cy={this.state.polygonPoints[2].y}
                        r={this.state.polygonCornerRadius}
                        fill={this.state.pressedCorner == 2 ? "white" : "pink"}
                    />
                    <Circle 
                        cx={this.state.polygonPoints[3].x}
                        cy={this.state.polygonPoints[3].y}
                        r={this.state.polygonCornerRadius}
                        fill={this.state.pressedCorner == 3 ? "white" : "pink"}
                    />
                    <Polygon
                        points={[
                            [this.state.polygonPoints[0].x, this.state.polygonPoints[0].y],
                            [this.state.polygonPoints[1].x, this.state.polygonPoints[1].y],
                            [this.state.polygonPoints[2].x, this.state.polygonPoints[2].y],
                            [this.state.polygonPoints[3].x, this.state.polygonPoints[3].y]
                        ]}
                        fill="#000"
                        fillOpacity="0"
                        stroke="white"
                        strokeWidth="3"
                        strokeDasharray="8, 3"
                    />            
                </Svg>
            </View>
            <Button style={{width: 50, height: 20, color: "#841584"}} title="Crop" onPress={this._crop}/>

            {croppedImageContent}

        </View>
      );
    }
}

const styles = StyleSheet.create({
    placeImage: {
        width: "100%",
        height: 265
    },
    mainContainer: {
        width: "100%"
    }
})
